import Body from './Body';
import heroImg from '../assets/cervinia.jpg';
import '../styles/Home';

export default class Home extends Component {
    render() {
        return (
            <div>
                <Body />
                <img src={heroImg} alt="Cervinia" className="heroImg" />
            </div>
        );
    }
}
